import { useState, useEffect } from "react";
import { useNavigate, useLocation, Link } from "react-router-dom";
import ScriptCard from "../components/ScriptCard";

function Scripts() {

    return (
        <>
            <button type="button" className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center mr-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">
                <Link to="/scripts/create">Create Script</Link>
            </button>
            <ScriptCard />
        </>
    );
}

export default Scripts;
